import React, { Component } from 'react';
import './App.css';
import Button from '@material-ui/core/Button';

class App extends Component {

    render() {
      return (
        <nav class="pa3 pa4-ns">
          <a class="link dim black b f1 f-headline-ns tc db mb3 mb4-ns" href="#" title="Home">Site Name</a>
          <div class="tc pb3">
            <Button class="link dim gray f6 f5-ns dib mr3" href="#" title="Home">Home</Button>
            <Button class="link dim gray f6 f5-ns dib mr3" href="#" title="About">About</Button>
            <Button class="Buttonink dim gray f6 f5-ns dib mr3" href="#" title="Store">Work</Button>
            <Button class="link dim gray f6 f5-ns dib" href="#" title="Contact">Contact</Button>
          </div>
        </nav>

        // <div class="flex" >
        //     <Button class="mr4">Home</Button>
        //     <Button class="mr4">About</Button>
        //     <h1 class="mr4">Katie Macaulay</h1>
        //     <Button class="mr4">Work</Button>
        //     <Button class="mr4">Contact</Button>
        // </div>
      );
    }
  }

  export default App;
